/* nimble light */
/* nimble light */
.settings-view .package-readme {
  font-size: 1.25em;
}
.settings-view .package-readme h1 {
  font-size: 2em;
  margin-top: 1.5em;
}
.settings-view .package-readme h2 {
  font-size: 1.75em;
  margin-top: 1.5em;
}
.settings-view .package-readme h3 {
  font-size: 1.5em;
  margin-top: 1.75em;
}
.settings-view .package-readme h4 {
  font-size: 1.25em;
  margin-top: 1.25em;
}
.settings-view .package-readme h1,
.settings-view .package-readme h2,
.settings-view .package-readme h3,
.settings-view .package-readme h4 {
  color: #102d21;
}
.settings-view .package-readme a {
  color: #5cadd6;
}
.settings-view .package-readme hr {
  border-color: rgba(58, 65, 62, 0.82);
}
.settings-view .package-readme blockquote {
  border-left-color: rgba(58, 65, 62, 0.82);
}
.settings-view .package-readme pre {
  margin-bottom: 1em;
}
.settings-view .package-readme img {
  max-width: 100%;
}
.settings-view .package-readme table {
  display: block;
  margin-bottom: 1em;
  width: 100%;
  overflow: auto;
  word-break: normal;
}
.settings-view .package-readme table th {
  font-weight: bold;
  text-align: center;
}
.settings-view .package-readme table th,
.settings-view .package-readme table td {
  padding: 6px 13px;
  border: 1px solid #939f9a;
}
.settings-view .package-readme table tr {
  border-top: 1px solid #939f9a;
  background-color: #c8d5cf;
}
.settings-view .package-readme table tr:nth-child(2n) {
  background-color: #c0e4d5;
}
.settings-view .package-readme kbd {
  display: inline-block;
  padding: .3em .4em;
  font-size: .8em;
  line-height: 1;
  color: #102d21;
  vertical-align: middle;
  background-color: #e5ebe8;
  border: solid 1px #939f9a;
  border-bottom-color: #788781;
  border-radius: 4px;
  box-shadow: inset 0 -1px 0 #788781;
}
